import React, { useEffect, useState } from "react";
import axios from "axios";

export default function AdminDashboard() {
  const [complaints, setComplaints] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const res = await axios.get("http://localhost:5000/api/complaints");
      setComplaints(res.data);
    };
    fetchData();
  }, []);

  return (
    <div className="max-w-5xl mx-auto mt-8 p-4">
      <h2 className="text-3xl font-bold text-gray-800 mb-6">Admin Dashboard</h2>
      {complaints.map((c, i) => (
        <div
          key={i}
          className="bg-white rounded-lg shadow-md p-4 mb-4 border-l-4 border-blue-500"
        >
          <p className="text-sm text-gray-600 font-semibold">Name: {c.name}</p>
          <p className="text-sm text-gray-600">Location: {c.location}</p>
          <p className="text-sm text-gray-800">Complaint: {c.complaint}</p>
          <p className="text-sm text-gray-500">Status: {c.status || "Pending"}</p>
        </div>
      ))}
    </div>
  );
}
